import React from 'react';
import { Container, Typography, Button, Box, Stack, Grid, Paper } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';
import SupportAgentIcon from '@mui/icons-material/SupportAgent';
import PublicIcon from '@mui/icons-material/Public';

const highlights = [
  {
    icon: <LocalHospitalIcon sx={{ fontSize: 48, color: '#1976d2' }} />,
    title: 'JCI-Accredited Hospitals',
    desc: 'Access world-class hospitals and seamless coordination for international care.'
  },
  {
    icon: <SupportAgentIcon sx={{ fontSize: 48, color: '#1976d2' }} />,
    title: '24/7 AI Patient Support',
    desc: 'Round-the-clock multilingual support for patients and facilitators.'
  },
  {
    icon: <PublicIcon sx={{ fontSize: 48, color: '#1976d2' }} />,
    title: 'Global Medical Tourism',
    desc: 'Expand your reach and attract patients from all over the world.'
  }
];

const Home = () => (
  <Box sx={{ background: 'linear-gradient(135deg, #e3f2fd 0%, #fff 100%)', minHeight: '100vh', pb: 8 }}>
    <Container maxWidth="lg" sx={{ pt: 10, textAlign: 'center' }}>
      <Typography variant="h2" fontWeight="bold" gutterBottom sx={{ fontFamily: 'serif', color: '#1a237e' }}>
        GoGetWell AI
      </Typography>
      <Typography variant="h5" color="text.secondary" gutterBottom sx={{ fontFamily: 'serif' }}>
        Transform your medical tourism business with AI-powered digital store and intelligent agents.
      </Typography>
      <Typography variant="body1" color="text.secondary" sx={{ mb: 4, maxWidth: 600, mx: 'auto' }}>
        Automate patient coordination, boost revenue, and provide 24/7 support for international medical treatments. Trusted by facilitators and hospitals worldwide.
      </Typography>
      <Stack direction={{ xs: 'column', sm: 'row' }} spacing={2} justifyContent="center" mt={4}>
        <Button
          component={RouterLink}
          to="/features"
          variant="contained"
          size="large"
          color="primary"
          sx={{ px: 4, fontWeight: 'bold', borderRadius: 8 }}
        >
          Explore Features
        </Button>
        <Button
          component={RouterLink}
          to="/pricing"
          variant="outlined"
          size="large"
          color="primary"
          sx={{ px: 4, borderRadius: 8 }}
        >
          View Pricing
        </Button>
      </Stack>
      <Grid container spacing={4} mt={6} justifyContent="center" sx={{ mt: { xs: 4, md: 8 } }}>
        {highlights.map((item, idx) => (
          <Grid item xs={12} sm={6} md={4} key={idx}>
            <Paper elevation={6} sx={{ p: 4, borderRadius: 4, bgcolor: '#fff', height: '100%' }}>
              {item.icon}
              <Typography variant="h6" fontWeight="bold" mt={2} gutterBottom sx={{ fontFamily: 'serif' }}>
                {item.title}
              </Typography>
              <Typography color="text.secondary">{item.desc}</Typography>
            </Paper>
          </Grid>
        ))}
      </Grid>
    </Container>
  </Box>
);

export default Home;
